import React from 'react';
import { Link } from 'react-router-dom';

const ListView: React.FC = () => {
  // Sample data for demonstration
  const items = [
    { id: 1, title: 'Item 1', description: 'This is the first item in the list' },
    { id: 2, title: 'Item 2', description: 'This is the second item in the list' },
    { id: 3, title: 'Item 3', description: 'This is the third item in the list' },
    { id: 4, title: 'Item 4', description: 'This is the fourth item in the list' },
    { id: 5, title: 'Item 5', description: 'This is the fifth item in the list' },
  ];

  return (
    <div className="list-view">
      <div className="button-container">
        <Link to="/" className="nav-button active">
          List View
        </Link>
        <Link to="/gallery" className="nav-button">
          Gallery View
        </Link>
      </div>

      <div className="list-container">
        <h2>Items List</h2>
        <ul className="items-list">
          {items.map((item) => (
            <li key={item.id} className="list-item">
              <div className="item-content">
                <h3>{item.title}</h3>
                <p>{item.description}</p>
              </div>
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
};

export default ListView;
